import React from 'react';
import { Text } from './components/Text';

export const Form = () => {
  const f = [
    { type: 'text', questionid: 1, question: "What's your name" },
    { type: 'radio', questionid: 2, question: "What's your sex" },
    { type: 'checkbox', questionid: 3, question: "What's your hobbies" },
    { type: 'date', questionid: 4, question: 'Date of birth' },
  ];
  const answers = {
    questionid: null,
    answer: null,
    answerOptionId: null,
  };
  const arr = [];
  const fields = (key) => {
    arr.push({ ...answers, questionid: key.questionid });
    switch (key.type) {
      case 'text':
        return <Text />;
      default:
        return null;
    }
  };
  return <div class='p-5'>fields</div>;
};
